(1, 'Conformément à l’article 04 du décret n° 2014-462 du 06 août 2014 portant attributions,\r\norganisation et fonctionnement de la Commission d’Accès à l’Information d’intérêt public et aux\r\nDocuments Publics (CAIDP), les organismes publics doivent produire , au premier trimestre\r\nde chaque année, un rapport sur l’application de la loi N° 2013-867 du 23 décembre\r\n2013 relative à l’accès à l’information. Ce rapport doit contenir notamment l’indication du\r\nnombre de requêtes reçues et la suite qui leur a été donnée.\r\nLe présent document est donc proposé aux organismes publics à titre de modèle type à\r\ncharge pour eux, de le renseigner et le transmettre à la Commission d’Accès à l’Information\r\nd’intérêt public et aux Documents Publics (CAIDP).', 'Ory Franck', 'Ory Franck', '2019-09-11', 1, '2019-09-11 15:57:54', '2019-09-11 15:57:54', 45),
